-- Mise en place du schéma :
drop schema if exists owid_covid_data cascade;
create schema owid_covid_data;

-- Création des tables :
CREATE TABLE owid_covid_data.Pays ( 
iso_CodePays varchar(8) PRIMARY KEY,  -- identifiant du pays
nomPays varchar(32), -- son nom
nomContinent varchar(32),   -- nom du continent
population bigint); --population du payss

CREATE TABLE owid_covid_data.Nouveaux_Morts (
id_Nouveaux_Morts SERIAL PRIMARY KEY, 
date_Nouveaux_Morts date,  --date concernant les nouveaux morts
stats_Nouveaux_Morts numeric, --stats des nouveaux morts
stats_Nouveaux_Morts_Smoothed numeric,  --stats des nouveaux morts smoothed
iso_CodePays varchar(8));
ALTER TABLE owid_covid_data.Nouveaux_Morts add constraint fk_Nouveaux_Morts_iso_CodePays FOREIGN KEY(iso_CodePays) REFERENCES owid_covid_data.Pays(iso_CodePays);

CREATE TABLE owid_covid_data.Nouveaux_Cas (
id_Nouveaux_Cas SERIAL PRIMARY KEY, 
date_Nouveaux_Cas date,  --date concernant les nouveaux morts
stats_Nouveaux_Cas numeric, --stats des nouveaux morts
stats_Nouveaux_Cas_Smoothed numeric, --stats des nouveaux morts smoothed
stats_Nouveaux_Cas_Par_Million numeric, --stats des nouveaux morts par million
stats_Nouveaux_Cas_Smoothed_Par_Million numeric,  --stats des nouveaux morts
iso_CodePays varchar(8));
ALTER TABLE owid_covid_data.Nouveaux_Cas add constraint fk_Nouveaux_Cas_iso_CodePays FOREIGN KEY(iso_CodePays) REFERENCES owid_covid_data.Pays(iso_CodePays);

CREATE TABLE owid_covid_data.Total_Cas (
id_Total_Cas SERIAL PRIMARY KEY, 
date_Total_Cas date, --date concernant les cas totaux
stats_Total_Cas numeric, --stats des nouveaux cas
stats_Total_Par_Million numeric,  --stats des nouveaux cas par million
iso_CodePays varchar(8));
ALTER TABLE owid_covid_data.Total_Cas add constraint fk_Total_Cas_iso_CodePays FOREIGN KEY(iso_CodePays) REFERENCES owid_covid_data.Pays(iso_CodePays);

CREATE TABLE owid_covid_data.Total_Morts (
id_Total_Morts SERIAL PRIMARY KEY, 
date_Total_Morts date, --date concernant les totaux du nombre de morts
stats_Total_Morts numeric, --stats des totaux des morts
stats_Total_Morts_Par_Million numeric,  --stats des totaux des morts par million
iso_CodePays varchar(8));
ALTER TABLE owid_covid_data.Total_Morts add constraint fk_Total_Morts_iso_CodePays FOREIGN KEY(iso_CodePays) REFERENCES owid_covid_data.Pays(iso_CodePays);

